import { Button, TextField } from "@material-ui/core";
import { Form, Formik, Field } from "formik";
import * as React from "react";
import { MyField } from "./MyField";


const initialValues: Values = {
    firstName: "", lastName: "", email: "", paso: 0, 
	arr: [{
		lbl1: [{lbl1: {"display":"none"}}]
	}]
};

export interface Values {
  firstName: string;
  lastName: string;
  email: string;
  paso: number;
    arr: Array<{
		lbl1: Array<{lbl1:{};}>;
    }>;
}
export interface Stl {
	[index:number]:Array<{
		propi:string;
		valor:string;
		}>;
	}
/*
interface defItem {
  [index: string]: defItemDeta;
}
interface defItemDeta {
  label1: string;
  label2: string;
  label3: string;
  label4: string;
  label5: string;
  label6: string;
  label7: string;
  label8: string;
  label9: string;
  label10: string;
  label11: string;
}*/

interface Props {
  onSubmit: (values: Values) => void;
}

export const MyForm: React.FC<Props> = ({ onSubmit }) => {
  return (
    <Formik
      initialValues={initialValues}
      onSubmit={values => {
        onSubmit(values);
      }}
    >
      {({ values }) => (              
        <Form>
			<div id="x" >
				test
			</div>
          <div>
            <Field
              name="firstName"
              placeholder="firsts name"
              
              component={MyField}
            />
          </div>
          <div>
            <Field
              name="lastName"
              placeholder="last name"
              
              component={MyField}
            />
          </div>
          <div>
            <Field name="email" 
			  placeholder="email" 
			  style={values.arr[values.paso].lbl1[0].lbl1}
              component={MyField} />
          </div>
          <div>
            <Field name="paso" 
			  placeholder="paso" 
			  
              component={MyField} />
          </div>
          <Button type="submit">submit</Button>
          <pre>{JSON.stringify(values, null, 2)}</pre>
        </Form>
      )}
    </Formik>
  );
};
